import React from 'react'
import Form from './Form'
import ShortenLinks from './ShortenLinks'
const Section1 = () => {
	var storage=JSON.parse(localStorage.getItem('links'))
	console.log(storage)
	return (
		<section className="Section1">
			<Form/>
			<ShortenLinks/>
		</section>
	)
}

export default Section1
